export default function ExpenseDate(dateProp){
    const month = dateProp.toLocaleString('en-US', {month: 'long'});
    const day = dateProp.toLocaleString('en-US', {year: '2-digit'});
    const year = dateProp.getFullYear();
    return (<div>{`${month} ${year}, ${day}`}</div>);
}
